(298, 1, ' <div id=\"wrap_id_advice_682\"> <section id=\"0_shoppingfeed\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Tips of the day </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/shoppingfeed.png\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/682.png\"/> <p> <b>Did you know that you can also easily sell on Google Shopping?</b> </p> <p> Create a catalogue on Google Shopping with your products and promote your online shop on search engines: increase your visibility and your traffic. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=682&url=http://addons.prestashop.com/en/marketplace-prestashop-modules/4184-shopping-feed.html?utm_source=back-office&utm_medium=tipoftheday&utm_campaign=partenariats&utm_content=shoppingfeed%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dshoppingfeed\"> Try for free! </a> </span> </div> </section><section id=\"1_shoppingfeed\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Tips of the day </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/shoppingfeed.png\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/682.png\"/> <p> <b>Multichannel is key to visibility</b> </p> <p> Diversify your sales channels (marketplaces, price comparators) and show your products to more qualified potential customers to increase your reach and boost your revenue. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=682&url=http://addons.prestashop.com/en/marketplace-prestashop-modules/4184-shopping-feed.html?utm_source=back-office&utm_medium=tipoftheday&utm_campaign=partenariats&utm_content=shoppingfeed%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dshoppingfeed\"> Try for free! </a> </span> </div> </section><section id=\"2_shoppingfeed\" class=\"panel\" style=\"display:none\"> <header class=\"panel-heading\"> <span class=\"icon-lightbulb\"></span> Tips of the day </header> <div class=\"panel-body\" style=\"padding:0\"> <img class=\"img-responsive\" src=\"https://storage.googleapis.com/production-gamification-assets/tips/shoppingfeed.png\" style=\"float:right; margin-left: 5px;\"> <img src=\"https://gamification.prestashop.com/api/getAdviceImg/682.png\"/> <p> <b>Sell on eBay, Amazon and Google Shopping... in a few clicks</b> </p> <p> Export your catalogue on marketplaces then manage your stocks and orders directly from your back office. </p> <span class=\"text-right\" style=\"float:right\"> <a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=682&url=http://addons.prestashop.com/en/marketplace-prestashop-modules/4184-shopping-feed.html?utm_source=back-office&utm_medium=tipoftheday&utm_campaign=partenariats&utm_content=shoppingfeed%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dshoppingfeed\"> Try for free! </a> </span> </div> </section><script> $(document).ready( function () { $(\'#\'+rand(2)+\'_shoppingfeed\').show(); }); function rand(nbr){ return Math.floor(Math.random()*(nbr+1)); } </script> </div>'),
