INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Shipping Policy', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipment and returns</h2>\n<p>We promise to provide you with the best-in-class shopping experience at every step of the way. We assure you that</p>\n<p>all due precautions are taken so that your package is delivered to you intact and on time by our delivery partner. Just</p>\n<p>proceed with your order and well do the rest.</p>\n<p>Making payment means accepting the delivery. Therefore, it is not possible to open products bearing a</p>\n<p>manufacturers seal, reject and send them back with the same driver (this can only be done before opening the</p>\n<p>package). Should you wish to return such products, you will have to follow the return process as defined in our return</p>\n<p>policy</p>', 'shipment'),
(3, 1, 1, 'Terms and conditions of use', 'Our terms and conditions of use', 'conditions, terms, use, sell', '<h3 class=\"page-heading\">Terms and conditions of use</h3>\n<p>All Orders are PREPAID and detailed payment instructions will be provided at the next step</p>\n<p></p>\n<h3>IMPORTANT:</h3>\n<p>1.<span>DON\'T WORRY - Your Money is SAFE! - check our </span> <a href=\"https://sandbox.nouveta.co.ke/Deacons/content/5-return-policy\"><span><span> <span>Return Policy</span></span></span></a></p>\n<p>2. Please check beforehand if you have money on your Credit/Debit card or Mpesa.</p>\n<p>3. Please DO NOT press Confirm Order unless you are sure of your order</p>\n<p></p>\n<h6><span><span> NOTE: By pressing confirm order it means you are ready to pre-pay. Your order will not go through if you don\'t prepay.</span></span></h6>', 'terms-and-conditions-of-use'),
(5, 1, 1, 'Return Policy', 'Our return Policy', '', '<h1>Exchange Policy</h1>\n<h2>What is Deacons return policy?</h2>\n<p>We will exchange any item you are not pleased with for another item (excluding Sale items) within 7 days of the date of purchase. Items must be accompanied by original receipt, and date and amount of purchase must be validated in our system. Merchandise must be in its original condition, unworn and unwashed. Customer identification may be required.</p>\n<p>Unfortunately, we dont do refunds, if you wish to exchange an item, please call us on +254719232340. You will speak to a customer service representative and arrange to have the item delivered back to our warehouse in exchange for another item.</p>\n<h3>Need a different Size?</h3>\n<p>If you would like to exchange an item for a different size, please contact us on+254719232340 within 7 days of your original purchase to let us know that you wish to do so, and indicate the size/color you prefer. Merchandise sent to us for exchange must be both unworn and unwashed with original tags. Our customer service representative will be happy to assist you and your new merchandise will be shipped out as soon as the return is received.</p>', 'return-policy'),
(6, 1, 1, 'Payment processing', '', '', '<h1><strong>PLEASE WAIT....</strong></h1>\n<h2><strong> Please check your phone to confirm the amount to pay by entering your M-PESA pin</strong></h2>\n<h2><strong>It may take upto 60 seconds</strong></h2>\n<h3>If you dont receive an STK push</h3>\n<ol>\n<li>\n<h3><strong>Select \'BUY GOODS AND SERVICES<span style=\"color:#222222;font-family:arial, sans-serif;font-size:16px;\">\' from your</span>M-PESA<span style=\"color:#222222;font-family:arial, sans-serif;font-size:16px;\">menu.</span></strong></h3>\n</li>\n<li>\n<h3><strong>Select \'PAY BILL\' option and enter the number 825445 .</strong></h3>\n</li>\n<li>\n<h3><strong>Enter the reference number sent to you as Account Number<span style=\"color:#222222;font-family:arial, sans-serif;font-size:16px;\">.</span></strong></h3>\n</li>\n<li>\n<h3><strong>Enter the total amount sent to you</strong></h3>\n</li>\n</ol>\n<h3></h3>', 'payment-processor'),
(7, 1, 1, 'Revocation terms', '', '', 'Please add your Revocation terms to this site.', 'aeu-legal-revocation-terms'),
(8, 1, 1, 'Privacy', '', '', 'Please insert here your content about privacy. If you have activated Social Media modules, please provide a notice about third-party access to data.', 'aeu-legal-privacy'),
(9, 1, 1, 'Shipping and payment', '', '', 'Please add your Shipping and payment information to this site.', 'aeu-legal-shipping-and-payment'),
(10, 1, 1, 'Environmental notice', '', '', 'Please add your Environmental information to this site.', 'aeu-legal-environmental-notice');
